import React from 'react';

const Weather = ({ weather,loading}) => {

    if(loading)
        return<h2>Loading...</h2>
    return(
        <ul>
           <li>
               Country = {weather.country}
           </li>
            <li>
               temperature= {weather.main}
            </li>
            <li>
               Pressure = {weather.pressure}
                </li>
            
        </ul>
        

    );
};

export default Weather;
